import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import S from "./styled";
import "../../utils/settingCookie";
import authClient from "../../apis/authClient";

const NickChange = () => {
  const navigate = useNavigate();

  const [nickname, setNickname] = useState("");
  const onNickHandler = (e) => {
    setNickname(e.currentTarget.value);
  };

  // api 명세서 업데이트 되면 수정 예정
  const onchangeNick = async () => {
    navigate("/MyAccount");
    try {
      const res = await authClient({
        method: "post",
        // url: `${process.env.REACT_APP_LOCAL}/auth/`,
        data: nickname,
      });
      console.log(res);
    } catch (error) {
      const err = error.response.data;
      console.log(err);
    }
  };

  return (
    <S.Container>
      <S.Title>닉네임 변경</S.Title>
      <S.Form>
        <S.Input
          type="text"
          // value={nickname}
          placeholder="변경할 닉네임을 입력하세요"
        ></S.Input>
        <S.nickCheck type="button" onClick={onchangeNick}>
          변경 버튼
        </S.nickCheck>
      </S.Form>
    </S.Container>
  );
};

export default NickChange;
